import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Weapons from "./components/Weapons";

function App() {
  return (
    <div>
      <Header />
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(2, 1fr)",
          gap: "8px",
          paddingBottom: "16px",
        }}
      >
        <Weapons title="Silah Grubu 1" />
        <Weapons title="Silah Grubu 2" />
        <Weapons title="Silah Grubu 3" />
        <Weapons title="Silah Grubu 4" />
        {/* Dilediğiniz kadar WeaponList ekleyebilirsiniz. */}
        <div
          style={{
            marginTop: "20px",
            borderTop: "2px solid #ccc",
            paddingTop: "10px",
          }}
        >
          <strong>Toplam Güç Çarpanı:</strong>{" "}
          {/* Burada toplam güç çarpanlarını toplamalısınız */}
          <br />
          <strong>Toplam Kilogram:</strong>{" "}
          {/* Burada toplam kilogramları toplamalısınız */}
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
